    "JPAの制御をするDC SQUIDの磁束をDCで制御するプログラムです．\n",
    "\n",
    "事前にやっておくこと\n",
    "\n",
    "・Anritsu立ち上げておくこと\n",
    "\n",
    "・制限電圧のセル起動(制限電圧の数値出力されるまで何回かセル試行) → NF エラー → 出力電圧高すぎる\n",
    "    \n",
    "    → 速やかにLOCALボタン押してＶ1 OUTPUT OFF"
