    "\n",
    "flag = 3\n",
    "# flag = 0, dc sweep with pump  \n",
    "pump = pwr + str(wf) \n",
    "# flag = 1, pump sweep\n",
    "pumpA = hex(min_pwr) + \"-\" + hex(max_pwr)\n",
    "# flag = 2, pump freq sweep with pump\n",
    "pumpB = pwr + str(min_wf) + \"-\" + str(max_wf) \n",
    "# flag = 3\n",
    "ohm = \"22k_\"\n",
    "print(flag)"
