    "\"\"\"JPAパラメータ・シーケンス\"\"\"\n",
    "\n",
    "\"\"\"キャリブレーション\"\"\"\n",
    "vna.send(str.encode(\"SENS1:CORR:COEF:CAL:FILE 'G:\\マイドライブ\\RyoyaOhashi\\SetupFile#1.chx'\"))\n",
    "\n",
    "\"\"\"グラフの定義\"\"\"\n",
    "plt.rcParams[\"font.size\"] = 14 #まとめてフォントサイズを変える\n",
    "fig = plt.figure(figsize=(20,10))\n",
    "ax1 = plt.subplot(2, 1, 1)\n",
    "ax2 = plt.subplot(2, 1, 2)\n",
    "\n",
    "\n",
    "\n",
    "\"\"\"保存先のパス\"\"\"\n",
    "now = datetime.datetime.now()\n",
    "# from %Y%m%d_%H%M%S_ to %m%d_%H%M_\n",
    "if flag ==0:\n",
    "    foldername = pump + \"_\" + now.strftime(f'%m%d_%H%M_') + minV + \"-\" + maxV + \"V_\" + start_freq + \"-\"  + end_freq\n",
    "elif flag ==1:\n",
    "    foldername = pumpA + \"_\" + now.strftime(f'%m%d_%H%M_') + minV + \"V_\" + start_freq + \"-\"  + end_freq\n",
    "elif flag ==2:\n",
    "    foldername = pumpB + \"_\" + now.strftime(f'%m%d_%H%M_') + minV + \"V_\" + start_freq + \"-\"  + end_freq\n",
    "elif flag ==3:\n",
    "    foldername = ohm + now.strftime(f'%m%d_%H%M_') + minV + \"-\" + maxV + \"V_\" + start_freq + \"-\"  + end_freq\n",
    "\n",
    "\n",
    "result_path = \"C:/Users/super/Desktop/RyoyaOhashi_C/{0}\".format(\n",
    "    foldername\n",
    ") # 実験結果の保存場所        \n",
    "os.makedirs(result_path, exist_ok=True)\n",
    "\n",
    "# \"\"\"グラフの保存\"\"\"\n",
    "# current_path = os.path.join(Path().resolve())\n",
    "# path_dir = '{0}/JPA_Result/XLD_each_phase/'.format(pathlib.Path(current_path).parents[1])  # 実験結果の保存場所\n",
    "# imgname = path_dir + str(foldername) +'.png'\n",
